var tipuesearch = {"pages": [{'title': 'Dart', 'text': 'Dart repository  https://github.com/dart-lang Office website  https://www.dartlang.org/ \n Dart is a great fit for both mobile apps and web apps.The advantage of Dart is,since it is a client optimized programming language for apps on multiple platforms,you can use it for as many purpose as Desktop,Mobile,backend and web aqpplicatios.Another advantage is it can be transcompoled into JavaScript.\xa0 \n Dart language is important for building mission-critical mobile apps on iOS and Android. If you already have a working knowledge in Object Oriented Language like Java or python,it will be much easier for you to understand the core concepts because using C-style syntax, Dart is a class define,garbage collected language. \n Dart 可以用於編譯手機應用程式及網站，而其中Dart的優點可以分為兩大類，第一類為可用於多種平台，第二為可轉成JavaScript \n Dart 是物件導向語言，而其句法與C語言語法相同。', 'tags': '', 'url': 'Dart.html'}, {'title': 'chapter1', 'text': '', 'tags': '', 'url': 'chapter1.html'}, {'title': 'chapter2', 'text': '', 'tags': '', 'url': 'chapter2.html'}, {'title': 'chapter3', 'text': '', 'tags': '', 'url': 'chapter3.html'}, {'title': 'chapter4', 'text': '', 'tags': '', 'url': 'chapter4.html'}, {'title': 'chapter5', 'text': '', 'tags': '', 'url': 'chapter5.html'}, {'title': 'chapter6', 'text': '', 'tags': '', 'url': 'chapter6.html'}, {'title': 'chapter7', 'text': '', 'tags': '', 'url': 'chapter7.html'}, {'title': 'chapter8', 'text': '', 'tags': '', 'url': 'chapter8.html'}, {'title': 'chapter9', 'text': '', 'tags': '', 'url': 'chapter9.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};